import React from 'react';

function Dashboard() {
  return (
    <div id="dashboard">
      <h3>Dashboard</h3>
      <button>Widgets</button>
      <button>Reviews</button>
      <button>Customers</button>
      <button>Online Analysis</button>
      <button>Settings</button>
      </div>
  );
}

export default Dashboard;
